def segment_activities(base_data, activities_df):
    # Dictionnaire pour stocker les groupes d'activités
    activity_groups = {}
    activity_lengths = {}

    # Itérer sur chaque activité dans le DataFrame des activités
    for index, row in activities_df.iterrows():
        activity_name = row['activity']
        start = row['Started'].tz_convert('Europe/Paris')
        end = row['Ended'].tz_convert('Europe/Paris')

        # Filtrer les données de la base pour chaque période d'activité
        activity_data = base_data[(base_data['Time'] >= start) & (base_data['Time'] <= end)]

        # Stocker les données filtrées dans le dictionnaire sous le nom de l'activité
        if activity_name not in activity_groups:
            activity_groups[activity_name] = [activity_data]
            activity_lengths[activity_name] = len(activity_data)
        else:
            activity_groups[activity_name].append(activity_data)
            activity_lengths[activity_name] += len(activity_data)

    return activity_groups, activity_lengths

