def plot_activity_signature(average_signature, activity_name):
    plt.figure(figsize=(10, 6))  # Set the figure size for better readability
    # Convert time index to strings for plotting if necessary
    time_strings = [time.strftime('%H:%M') for time in average_signature.index]
    for column in average_signature.columns:
        plt.plot(time_strings, average_signature[column], label=column)
    plt.title(f'Average Response of {activity_name}')
    plt.xlabel('Time (minutes)')
    plt.ylabel('Sensor Measurements')
    plt.legend()
    plt.grid(True)
    plt.xticks(rotation=45)  # Rotate time labels for better visibility
    plt.show()



